(null,"14853","","290","sitemap","Domov","domov","0","0","homepage","","","2019-02-22 21:30:11","2019-03-11 17:12:49","2019-02-22 21:30:00","0","","<p>&nbsp;</p>\n\n<p>Sme firma s dlhoročn&yacute;mi sk&uacute;senosťami v nov&yacute;ch a modern&yacute;ch priestoroch. Svetu predaja a servisu bicyklov sa venujeme od roku 2002. N&aacute;&scaron; t&iacute;m ktor&yacute; sa o V&aacute;s star&aacute; je zložen&yacute; z ľud&iacute; ktor&yacute; maj&uacute; sk&uacute;senosti s akt&iacute;vnym aj rekreačn&yacute;m cyklistick&yacute;m &scaron;portom s bohat&yacute;mi servisn&yacute;mi sk&uacute;senosťami a s ochotou v&aacute;m vždy pom&ocirc;cť a poradiť.</p>\n\n<p>V na&scaron;ej ponuke n&aacute;jdete &scaron;irok&yacute; sortiment bicyklov a doplnkov renomovan&yacute;ch značiek. V ponuke n&aacute;jdete aj veľk&yacute; vyber bicyklov od Slovensk&yacute;ch v&yacute;robcov. V&auml;č&scaron;ina nami pred&aacute;van&yacute;ch produktov je nami a na&scaron;ou skupinou jazdcov neust&aacute;le testovan&aacute;.</p>\n","","","","","10","1","","0","56","0"),
(null,"14854","","290","sitemap","Bicykle","bicykle","0","0","singl_page","","3071","2019-02-22 21:31:08","2019-03-11 10:59:22","2019-02-22 21:31:00","0","<p>V na&scaron;ej ponuke n&aacute;jdete modely t&yacute;ch najlep&scaron;&iacute;ch značiek bicyklov. Od cestn&yacute;ch cez trekingov&eacute; až po horsk&eacute; bicykle. Z&aacute;roveň n&aacute;jdete u n&aacute;s elektro bicyklov. V na&scaron;ich predajniach n&aacute;jdete aj cyklo doplnky, oblečenie a cyklo n&aacute;radie.</p>\n","<p>Značkov&eacute; bicykle od renomovan&yacute;ch v&yacute;robcov<strong> Merida, Cube, Ghost a Lapierre</strong> s&uacute; doplnen&eacute; aj o na&scaron;e lok&aacute;lne, slovensk&eacute; a česk&eacute; značky ako jeDema, Leader Fox a Author. U n&aacute;s si vyberie bicykel každ&yacute; cyklista, m&aacute;me v ponuke horsk&eacute;, krosov&eacute;, trekingov&eacute;, detsk&eacute;, mestsk&eacute;, cestn&eacute;bicykle, ale aj okrajov&eacute; druhy ako cyklokrosov&eacute;, freestyle, dirt, BMX a fitness bicykle. BMX bicykle pon&uacute;kame od &scaron;pičkov&yacute;ch značiek Cult, Wethepeople, Subrosa, Fiend a BeFly.</p>\n\n<p>&nbsp;</p>\n\n<p><img alt=\"\" class=\"center-block\" src=\"/dnt-view/data/uploads/formats/350/56_58bd3e3ffd3aff5e7a449e6fb2139400_o.jpg\" style=\"max-width:350px\" /></p>\n","","","","","9","1","","0","56","0"),
