(null,"14856","","290","sitemap","Servis","servis","0","0","singl_page","","3073","2019-02-22 21:54:53","2019-03-11 10:59:33","2019-02-22 21:54:00","0","<p>Pon&uacute;kame v&aacute;m odborn&yacute; bicyklov&yacute; servis, ktor&yacute; zabezpečuje bajkula bike Service, s.r.o., prevent&iacute;vne komplexn&eacute; prehliadky a gener&aacute;lne opravy, bezplatn&uacute; diagnostiku technick&eacute;ho stavu V&aacute;&scaron;ho bicykla, profesion&aacute;lny servis značkov&yacute;ch vidl&iacute;c a tlmičov - v spolupr&aacute;ci so Suspenslon Cllnlc.</p>\n","<p>D&ocirc;ležit&eacute; Inform&aacute;cie o fungovan&iacute; n&aacute;&scaron;ho bajkula blke servisu: Mil&iacute; z&aacute;kazn&iacute;ci, čoraz častej&scaron;ie sa st&aacute;va, že sa vyberiete do n&aacute;&scaron;ho servisu bez ohl&aacute;senia a absolvujete cestu nadarmo. Aby sme predi&scaron;li v&aacute;&scaron;mu sklamaniu a u&scaron;etrili v&aacute;&scaron; čas, servis prij&iacute;mame celoročne len na z&aacute;klade dopredu dohodnutej objedn&aacute;vky. Rezervujte sl najbliž&scaron;&iacute; voľn&yacute; term&iacute;n na na&scaron;om telef&oacute;nnom č&iacute;sle 02/5263 5454 alebo osobne na predajni.</p>\n\n<p>Na bezplatn&uacute; garančn&uacute; prehliadku na u n&aacute;s zak&uacute;pen&yacute; bicykel sa nemus&iacute;te objedn&aacute;vať a servis v&aacute;m podľa možnost&iacute; vykon&aacute;me</p>\n\n<p>Prev&aacute;dzkov&aacute; doba servisu: Pondelok - Piatok: 9:00 -18:00 Sobota: Zatvoren&eacute; (obchod je ale otvoren&yacute;) Nedeľa: Zatvoren&eacute;.</p>\n\n<p>Na u n&aacute;s zak&uacute;pen&eacute; bicykle poskytujeme lacnej&scaron;&iacute; a r&yacute;chlej&scaron;&iacute; servis. Po &ocirc;smich sez&oacute;nach, ktor&eacute; m&aacute;me vďaka v&aacute;m - na&scaron;im z&aacute;kazn&iacute;kom &uacute;spe&scaron;ne za sebou, chceme zefekt&iacute;vniť fungovanie a kvalitu n&aacute;&scaron;ho servisu. D&ocirc;vodom zmien, ktor&eacute; v&aacute;m predstav&iacute;me, je čoraz v&auml;č&scaron;&iacute; dopyt o servisn&eacute; služby. Je to jednoduch&eacute;, ak m&aacute;te u n&aacute;s zak&uacute;pen&yacute; bicykel, ste prednostne prijat&iacute; do servisu a za pr&aacute;cu zaplat&iacute;te menej ako klienti, ktor&iacute; u n&aacute;s bicykel nekupovali. Navy&scaron;e s na&scaron;ou z&aacute;kazn&iacute;ckou kartou nakupujete pri servise lacnej&scaron;ie n&aacute;hradn&eacute; diely, komponenty a doplnky.</p>\n\n<p>Ďal&scaron;&iacute;m benefitom je akcia ZIMN&Aacute; GENER&Aacute;LKA, ktor&aacute; je len pre z&aacute;kazn&iacute;kov, ktor&iacute; si u n&aacute;s zak&uacute;pili bicykel. ZIMN&Aacute; GENER&Aacute;LKA so zv&yacute;hodnen&iacute;m -40% na servisn&eacute; pr&aacute;ce trv&aacute; počas cel&eacute;ho febru&aacute;ra. (Akcia sa nevzťahuje na servisn&eacute; pr&aacute;ce na vidliciach a tlmičoch.) Cena pr&aacute;ce na bicykle, ktor&eacute; neboli zak&uacute;pen&eacute; u n&aacute;s: Napriek tomu, že ste sl u n&aacute;s bicykel nezak&uacute;plli, m&ocirc;žete mat v&yacute;hodnej&scaron;&iacute; servis aj vy.</p>\n\n<p>Cena pr&aacute;ce na bicykle, ktor&eacute; neboli zak&uacute;pen&eacute; u n&aacute;s je s&iacute;ce vy&scaron;&scaron;ia, ale ak ste n&aacute;&scaron; vern&yacute; z&aacute;kazn&iacute;k a m&aacute;te na&scaron;u z&aacute;kazn&iacute;cku kartu, m&aacute;te zľavu 20% zo z&aacute;kladnej hodinovej sadzby (určenej pre u n&aacute;s nekupovan&eacute; bicykle).</p>\n\n<p>&nbsp;</p>\n\n<p><img alt=\"\" class=\"center-block\" src=\"/dnt-view/data/uploads/formats/350/56_955383120bb11e0ef5304cff9cce016b_o.jpg\" style=\"max-width:350px\" /></p>\n","","","","","8","1","","0","56","0"),
