(null,"14862","14856","291","sitemap","Shimano servis centrum","shimano-servis-centrum","0","0","singl_page","","3075","2019-02-22 22:33:36","2019-03-11 11:01:13","2019-02-22 22:33:00","0","<p>Sme SHIMANO Service Centrum. Snaž&iacute;me sa tak prispieť k e&scaron;te v&auml;č&scaron;ej miere spokojnosti na&scaron;ich z&aacute;kazn&iacute;kov. Prin&aacute;&scaron;ame V&aacute;m pr&iacute;jemn&eacute; prostredie a bohat&eacute; sk&uacute;senosti v oblasti poradenstva i servisu. Na na&scaron;ej jabloneckej predajni n&aacute;jdete predajn&uacute; plochu vyhraden&uacute; priamo pre prezent&aacute;ciu origin&aacute;lnych n&aacute;hradn&yacute;ch dielov a komponentov Shimano.</p>\n","<p>V ponuke n&aacute;&scaron;ho eshopu n&aacute;jdete kompletn&uacute; ponuku dielov Shimano, od z&aacute;kladn&yacute;ch s&aacute;d, až po profesion&aacute;lne komponenty typu XTR či jeuiny v uueiecKum Kiaji.</p>\n\n<p>Na&scaron;i mechanici s&uacute; v r&aacute;mci SSC pravidelne &scaron;kolen&iacute;, a zaist&iacute;me tak profesion&aacute;lny servis V&aacute;&scaron;ho bicykla a to aj vr&aacute;tane &scaron;pecializ&aacute;cie na Di2, či elektromotory Steps. Na servise použ&iacute;vame v&yacute;hradne origin&aacute;lne n&aacute;hradn&eacute; diely a n&aacute;radie Shimano, vďaka čomu je dosiahnut&aacute; maxim&aacute;lna kompatibility a funkčnosti s komponentmi Shimano.</p>\n\n<p>&nbsp;</p>\n\n<p><img alt=\"\" class=\"center-block\" src=\"/dnt-view/data/uploads/formats/350/56_33e592b65ee27666ab938e2ca9f39f12_o.jpg\" style=\"max-width:350px\" /></p>\n","","","","","0","1","","0","56","0"),
